query StreamsQuery($sender: String!) {
  streams(where: {sender: $sender}) {
    id
    currentFlowRate
    createdAtTimestamp
    receiver {
      id
    }
  }
}

query IncomingStreamsQuery($receiver: String!) {
  streams(where: {receiver: $receiver}) {
    id
    currentFlowRate
    createdAtTimestamp
    sender {
      id
    }
  }
}
